function play(state, action = 'new') {
    if (!state || state.fin || action === 'new') {
        return getNewState();
    }
    if (action === 'bksp') {
        return removeAlphabet(state);
    }
    if (action === 'enter') {
        return submitGuess(state);
    }
    if (action.length === 1 && action >= 'a' && action <= 'z') {
        return addAplhabet(state, action);
    }
    return state;
}

